import gsap from "gsap"
import Observer from "gsap/Observer"

export const openNav = ()=>{
    gsap.fromTo('.navBox', {
        duration: 0.2,
        opacity: 0
    }, {
        opacity: 1, display: "grid"
    })
}

export const closeNav = ()=>{
    alert("Closed")
}
